        import oracle.odi.domain.model.OdiDataStore
        import oracle.odi.domain.mapping.exception.MappingException
        import oracle.odi.km.exception.OdiKMException

        public class LKM_BICC_to_ADW_Copy_Direct extends LKM_Object_Storage_to_ADWC_Copy_Direct {

                protected String sourceDataStoreName;
                protected String lastLoad;
                protected String timeout;
                protected String biccEndPoint;
		        protected String biccUsername;
		        protected String biccPassword;
                protected String biccLSchemaName;
                protected String storageName;
                protected String isObjectStorage;
                protected String objectStoreLocation;
                protected String objectStoreLocationOld;
                protected String csLocation;
                protected String csUser;
                protected String csPwd;

                public void setBinding(Binding binding) {

                    super.setBinding(binding);

                    Map variables = binding.getVariables();

		            biccLSchemaName = getSourceSchemaName();
		            binding.setVariable("biccLSchemaName", biccLSchemaName);

                    dynamicURIList = 'true'
                    binding.setVariable("dynamicURIList", dynamicURIList);

                    skipHeaders = 1;
		            binding.setVariable("skipHeaders", skipHeaders);

		            // fileFormat = 'D';
		            // binding.setVariable("fileFormat", fileFormat);

		            // fieldSeparator = ",";
		            // binding.setVariable("fieldSeparator", fieldSeparator);

                    isObjectStorage = '<%=odiRef.getDataServerInfo( "BICC_OBJECT_STORAGE_IS_DATA_SERVER", "' + biccLSchemaName + '")%>';
                    binding.setVariable("isObjectStorage", isObjectStorage);

		            // ===================================

                    objStoreUser = '<%=odiRef.getDataServerInfo( "BICC_OBJECT_STORAGE_USERNAME", "' + biccLSchemaName + '")%>';
                    binding.setVariable("objStoreUser", objStoreUser);

                    swiftPwd = '<%=odiRef.getDataServerInfo("BICC_OBJECT_STORAGE_SWIFT_PASS", "' + biccLSchemaName + '")%>'
                    binding.setVariable("swiftPwd", swiftPwd);

                    region = '<%=odiRef.getDataServerInfo( "BICC_OBJECT_STORAGE_REGION", "' + biccLSchemaName + '")%>';
                    binding.setVariable("region", region);

                    tenant = '<%=odiRef.getDataServerInfo( "BICC_OBJECT_STORAGE_TENANT_NAME", "' + biccLSchemaName + '")%>';
                    binding.setVariable("tenant", tenant);

                    namespace = '<%=odiRef.getDataServerInfo( "BICC_OBJECT_STORAGE_NAMESPACE", "' + biccLSchemaName + '")%>';
                    binding.setVariable("namespace", namespace);

                    def bucket = '<%=odiRef.getDataServerInfo( "BICC_OBJECT_STORAGE_BUCKET", "' + biccLSchemaName + '")%>';

                    // objectStoreLocation = "https://objectstorage." + region + ".oraclecloud.com/n/" + tenant + "/b/" + bucket;
                    objectStoreLocation = "https://objectstorage." + region + ".oraclecloud.com/n/" + namespace + "/b/" + bucket;
                    binding.setVariable("objectStoreLocation", objectStoreLocation);

                    // objectStoreLocationOld = "https://swiftobjectstorage." + region + ".oraclecloud.com/v1/" + tenant + "/" + bucket;
                    objectStoreLocationOld = "https://swiftobjectstorage." + region + ".oraclecloud.com/v1/" + namespace + "/" + bucket;
                    binding.setVariable("objectStoreLocationOld", objectStoreLocationOld);

                    // ===================================


                    csUser = '<%=odiRef.getDataServerInfo( "BICC_STORAGE_CS_USERNAME", "' + biccLSchemaName + '")%>';
                    binding.setVariable("csUser", csUser);

                    csPwd = '<%=odiRef.getDataServerInfo("BICC_STORAGE_CS_PASSWORD", "' + biccLSchemaName + '")%>'
                    binding.setVariable("csPwd", csPwd);

                    def serviceURL = '<%=odiRef.getDataServerInfo( "BICC_STORAGE_CS_SERVICE_URL", "' + biccLSchemaName + '")%>';
                    def serviceName = '<%=odiRef.getDataServerInfo("BICC_STORAGE_CS_SERVICE_NAME", "' + biccLSchemaName + '")%>';
                    def identityDomain = '<%=odiRef.getDataServerInfo( "BICC_STORAGE_CS_IDENTITY_DOMAIN", "' + biccLSchemaName + '")%>';

                    def container = '<%=odiRef.getDataServerInfo( "BICC_STORAGE_CS_CONTAINER", "' + biccLSchemaName + '")%>';

                    csLocation = serviceURL + "/v1/"+ serviceName + "-" + identityDomain + "/" + container;
                    binding.setVariable("csLocation", csLocation);

                    // ===================================

		            def option = physicalNode.getOptionValue(IKnowledgeModule.ProcessingType.SOURCE, 'COMPRESSION');
                    option.setValue("gzip")

                    option = physicalNode.getOptionValue(IKnowledgeModule.ProcessingType.SOURCE, 'TIMESTAMP_FORMAT');
                    option.setValue("YYYY-MM-DD HH24:MI:SS.FF6")

                    formatProperties = getFormatPropsList();
                    binding.setVariable("formatProperties", formatProperties);

                    String delimitedOption = getOptionValue("DELIMITED_FILE_FORMAT");
                    if (!delimitedOption.equals("CSV")) {
                        option = physicalNode.getOptionValue(IKnowledgeModule.ProcessingType.SOURCE, 'ADD_FORMAT_PROPERTIES');
                        String newProp = "'removequotes' VALUE 'true'"
                        if (option.getValue() != null && !option.getValue().getText().contains("removequotes")) {
                            option.setValue(option.getValue().getText() + "," + newProp)
                        } else {
                            option.setValue(newProp)
                        }
                    }

                    OdiDataStore dataStore = (OdiDataStore)sourceNode.getLogicalComponent().getBoundObject();
                    sourceDataStoreName = dataStore.getResourceName();
                    binding.setVariable("sourceDataStoreName", sourceDataStoreName);

                    lastLoad = getOptionValue("LAST_LOAD_DATE");
                    if (lastLoad == null) { lastLoad = "" }
                    binding.setVariable("lastLoad", lastLoad);

                    timeout = getOptionValue("BICC_JOB_TIMEOUT");
                    if (timeout == null) { timeout = "" }
                    binding.setVariable("timeout", timeout);

		            biccEndPoint = '<%=odiRef.getDataServerInfo("BICC_SERVICE_URL", "' + biccLSchemaName + '")%>'
                    binding.setVariable("biccEndPoint", biccEndPoint);

		            biccUsername = '<%=odiRef.getDataServerInfo("BICC_USERNAME", "' + biccLSchemaName + '")%>'
                    binding.setVariable("biccUsername", biccUsername);

		            biccPassword = '<%=odiRef.getDataServerInfo("BICC_PASSWORD", "' + biccLSchemaName + '")%>'
                    binding.setVariable("biccPassword", biccPassword);

                    storageName = '<%=odiRef.getDataServerInfo("BICC_EXTERNAL_STORAGE_NAME", "' + biccLSchemaName + '")%>'
                    binding.setVariable("storageName", storageName);

                }

                String getColNamesUpperCased (MapPhysicalNode node) {
                   def columns = node.getLogicalComponent().getBoundObject().getColumns();

                   StringBuilder columnBuilder = new StringBuilder();
                   for (def column : columns) {
                      if (columnBuilder.length() > 0) {
                         columnBuilder.append(", ");
                      }
                      columnBuilder.append(column.getName().toUpperCase());
                   }
                   return columnBuilder.toString();
                }
            }
